import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { AppointmentComponent } from './Doctor/appointment/appointment.component';
import { Routes } from '@angular/router';
import { FormsModule } from '@angular/forms';
import { DoctorLoginComponent } from './Doctor/doctorlogin/doctorlogin.component';
const appRoutes: Routes = [						
  { path: '', component: AppointmentComponent },
  { path: 'doctor', component: DoctorLoginComponent },

]
@NgModule({
  declarations: [
    AppComponent,
    AppointmentComponent,
    DoctorLoginComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule
  ],
  providers: [],
  bootstrap: [DoctorLoginComponent]
})
export class AppModule { }
